import React, { Component } from 'react'
import initState from "../Redux/index";

export class List extends Component {
  render() {
    return (
     initState.todoitems.map((item,key)=>
          <li key = {key}className="list-group-item"   > 
          <input type="checkbox" className="float-left my-3" onClick={this.props.checkmate.bind(this,key)} />  
          <input type="text" value={item.caption} className="myinput" onChange={this.props.keyPress.bind(this,key)} />              
          <button className="mybtn float-right" onClick ={this.props.removeItem.bind(this,key)} > X </button>               
          </li>          
    )
    )
  }
}


export default List;
